    def self.get_icon_for(device_type)
      if device_type.class == String
        encoded_icon = @@icon_hash[device_type]
        return encoded_icon if encoded_icon

        device_type = device_type.split(/\d/)[0]
        encoded_icon = @@icon_hash[device_type]
        return encoded_icon if encoded_icon
      end
      # send a imac icon if dont find anything
      return ''
    end
